import axios from 'axios'
export const GET_COUNTRIES = 'GET'




export function getCountries () {
    return function (dispatch) {
      axios.get("http://localhost:3001/countries/")
      .then((response) => {
        dispatch({
            type: GET_COUNTRIES,
            payload: response.data
        })
        })
      .catch((error) => console.log(error));
  };
}
